transforms.result:
.collaborate-page {
  background-image: url("https://res.cloudinary.com/dn0br7hj0/image/upload/background/Background2.webp");
  background-repeat: repeat;
  background-position: top center;
  background-size: 300px;
  image-rendering: -webkit-optimize-contrast;
  image-rendering: crisp-edges;
  padding: 40px 20px;
}

.collaborate-page-title {
  font-family: "Mythical-Prince", "LouvreSerif", Georgia, "Times New Roman",
    serif;
  text-align: center;
  color: #2c2f11;
  margin-bottom: 40px;
  font-size: 2.5rem;
}

.card-grid-collaborate {
  display: grid;
  grid-template-columns: repeat(2, 1fr);
  gap: 20px;
  max-width: 1200px;
  margin: 0 auto;
}

.card-item-collaborate {
  position: relative;
  overflow: hidden;
  transition: transform 0.3s ease;
}

.card-item-collaborate:hover {
  transform: translateY(-5px);
}

.card-item-collaborate img {
  width: 100%;
  height: 300px;
  object-fit: cover;
}

.card-content-collaborate {
  align-items: center;
  text-align: center;
}

.card-content-collaborate .card-title {
  font-family: "Roboto", sans-serif;
  font-size: 1.3rem;
  margin-bottom: 8px;
  color: #2c2f11;
}

.card-content-collaborate .card-product-count {
  font-size: 0.9rem;
  color: #000;
}

@media (min-width: 1024px) {
  .card-grid-collaborate {
    grid-template-columns: repeat(4, 1fr);
  }
}
